INF = float('inf')
MOD = 10**9 + 7

def solve():
    H, W = list(map(int, readline().split()))
    S = [''] + readline().split()
    for i in range(H):
        S[i] = int(S[i])
    dp = [[0]*W for _ in range(H)]
    for i in range(H):
        for j in range(W):
            if S[j] == '.':
                dp[i][j] = 1
            elif S[j] == '#':
                dp[i][j] = INF
            else:
                x, y = i-1, j-1
                if 0<=x<W and 0<=y<W:
