class Solution:
     def twoSum(self, nums, target):
         """
         :type nums: List[int]
         :type target: int
         :rtype: List[int]
         """
         if not nums:
             return []
         res = []
         for i in range(len(nums)):
             if target%(i+1)==0:
                 res.append(i)
                 if nums[i]==target//(i+1):
                     res.append(i+1)
             elif target%(i+1)==0:
                 res.append(i)
                 if nums[i]==target//(i+1):
                     res.append(i+1)
         return res

