import sys
input = sys.stdin.readline

class Poly():
    def __init__(self, n, coef=0):
        self.n = n
        self.coefs = [coef] * (n + 1)
        self.p = [0] * (n + 1)
        for i in range(n):
            self.p[i + 1] = self.p[i] + self.coefs[i]
        self.doubling = 0

    def compute(self, i):
        x = self.p[i]
        self.doubling += (x!= 0)
        return x

    def __getitem__(self, key):
        return self.p[key]

    def __setitem__(self, key, value):
        self.p[key] = value

def main():
    n = int(input())
    coef = [0] * (n + 1)
    for i in range(1, n + 1):
        coef[i] = coef[i - 1] + i

    poly = Poly(n)
    for i in range(n - 1):
        poly.compute(i + 1)
        poly.calculate(i)

